import React, { useState } from "react";
import ReactDOM from 'react-dom';
// import { Route, Switch, withRouter, Redirect,BrowserRouter } from "react-router-dom";

import { makeStyles } from "@material-ui/core/styles";
import Button from "@material-ui/core/Button";
import Box from "@material-ui/core/Box";
import Container from "@material-ui/core/Container";

import FloatingActionButtonZoom from "../components/view/FloatingActionButton";
import BottomNavigation from "../components/view/BottomNavigation";
import DayPlanPC from "./DayPlan";
import Tasks from "./tasks";
import FormComponent from "../components/test/firebaseTest/FormComponent";
import { useSelector } from "react-redux";
import { RootState } from "../modules/rootReducer";

const useStyles = makeStyles({
    button: {
        backgroundColor: "green",
    },
});

const App = () => {
    const { userId } = useSelector((state: RootState) => state.user);

    let RenderComponent:JSX.Element;
    if(userId==''){
        RenderComponent = <FormComponent />;
    }else{
        RenderComponent = <DayPlanPC />;
    }


    return (

        RenderComponent
        // <DayPlanPC />
        // <Tasks />
        // <BrowserRouter>{routes}</BrowserRouter>
        // <Container fixed>
        //     <h1>Todo App</h1>
        //     <Box component="span" m={1} className={classes.button}>
        //         {/* <Button variant="contained" color="primary">
        //                 Test
        //             </Button> */}
        //         <FloatingActionButtonZoom />
        //         <BottomNavigation />
        //     </Box>
        //     {/* <Box>
        //     </Box> */}
        // </Container>
    );
};

export default App;
// ReactDOM.render( App );
